import React, { useState, useEffect } from 'react';
import { Container, Box, Paper, Tabs, Tab } from '@mui/material';
import WorkOutlineIcon from '@mui/icons-material/WorkOutline';
import SchoolOutlinedIcon from '@mui/icons-material/SchoolOutlined';
import FavoriteBorderIcon from '@mui/icons-material/FavoriteBorder';
import TaskList from './TaskList';

function TaskDashboard() {
  const [taskLists, setTaskLists] = useState(() => {
    const saved = localStorage.getItem('neuranote-task-lists');
    if (saved) {
      return JSON.parse(saved);
    }
    return {
      work: {
        id: 'work',
        name: 'Work',
        icon: 'work',
        color: '#A78BFA',
        tasks: [
          { id: 1, title: 'Complete SRS Document', completed: false },
          { id: 2, title: 'Design database schema', completed: false },
        ]
      },
      study: {
        id: 'study',
        name: 'Study',
        icon: 'study',
        color: '#06B6D4',
        tasks: [
          { id: 3, title: 'Prepare interim demo', completed: true },
          { id: 4, title: 'Read React documentation', completed: false },
        ]
      },
      personal: {
        id: 'personal',
        name: 'Personal',
        icon: 'personal',
        color: '#10B981',
        tasks: [
          { id: 5, title: 'Buy groceries', completed: false },
        ]
      }
    };
  });

  const [activeList, setActiveList] = useState('work');

  useEffect(() => {
    localStorage.setItem('neuranote-task-lists', JSON.stringify(taskLists));
  }, [taskLists]);

  const handleToggle = (taskId) => {
    setTaskLists(prev => ({
      ...prev,
      [activeList]: {
        ...prev[activeList],
        tasks: prev[activeList].tasks.map(t =>
          t.id === taskId ? { ...t, completed: !t.completed } : t
        )
      }
    }));
  };

  const handleAdd = (title) => {
    const newTask = {
      id: Date.now(),
      title,
      completed: false
    };
    setTaskLists(prev => ({
      ...prev,
      [activeList]: {
        ...prev[activeList],
        tasks: [...prev[activeList].tasks, newTask]
      }
    }));
  };

  const handleDelete = (taskId) => {
    setTaskLists(prev => ({
      ...prev,
      [activeList]: {
        ...prev[activeList],
        tasks: prev[activeList].tasks.filter(t => t.id !== taskId)
      }
    }));
  };

  const getIcon = (iconType) => {
    switch(iconType) {
      case 'work': return <WorkOutlineIcon />;
      case 'study': return <SchoolOutlinedIcon />;
      case 'personal': return <FavoriteBorderIcon />;
      default: return null;
    }
  };

  return (
    <Box 
      sx={{ 
        minHeight: '100vh', 
        bgcolor: 'background.default',
        p: 3,
        position: 'relative',
        '&::before': {
          content: '""',
          position: 'absolute',
          top: 0,
          left: 0,
          right: 0,
          height: '400px',
          background: 'radial-gradient(circle at 50% 0%, rgba(139, 92, 246, 0.15) 0%, transparent 50%)',
          pointerEvents: 'none',
        }
      }}
    >
      <Container maxWidth="md">
        <Paper 
          elevation={0}
          sx={{ 
            p: 4, 
            bgcolor: 'background.paper',
            borderRadius: 3,
            minHeight: '650px',  // ← FIXED HEIGHT!
            display: 'flex',
            flexDirection: 'column',
            position: 'relative',
            overflow: 'hidden',
            '&::before': {
              content: '""',
              position: 'absolute',
              top: 0,
              left: 0,
              right: 0,
              height: '1px',
              background: 'linear-gradient(90deg, transparent, rgba(139, 92, 246, 0.5), transparent)',
            }
          }}
        >

          {/* Tabs */}
          <Tabs 
            value={activeList} 
            onChange={(e, newValue) => setActiveList(newValue)}
            sx={{ 
              mb: 4,
              borderBottom: 1,
              borderColor: 'rgba(139, 92, 246, 0.1)',
              '& .MuiTab-root': {
                color: 'text.secondary',
                textTransform: 'none',
                fontSize: '0.95rem',
                fontWeight: 500,
                minHeight: '48px',
                transition: 'all 0.3s',
                '&:hover': {
                  color: 'primary.main',
                  background: 'rgba(139, 92, 246, 0.05)',
                },
                '&.Mui-selected': {
                  color: 'primary.main',
                  fontWeight: 600,
                }
              },
              '& .MuiTabs-indicator': {
                height: '3px',
                borderRadius: '3px 3px 0 0',
                background: 'linear-gradient(90deg, #A78BFA, #06B6D4)',
              }
            }}
          >
            {Object.values(taskLists).map(list => (
              <Tab 
                key={list.id} 
                value={list.id} 
                icon={getIcon(list.icon)}
                iconPosition="start"
                label={list.name}
              />
            ))}
          </Tabs>

          {/* Task List - takes remaining space */}
          <Box sx={{ flex: 1, display: 'flex', flexDirection: 'column' }}>
            <TaskList
              listName={taskLists[activeList].name}
              listColor={taskLists[activeList].color}
              tasks={taskLists[activeList].tasks}
              onToggle={handleToggle}
              onAdd={handleAdd}
              onDelete={handleDelete}
            />
          </Box>
        </Paper>
      </Container>
    </Box>
  );
}

export default TaskDashboard;
